  input: TEXT,F3XA,,"1.  The Committee is a joint fundraising representative on behalf
    of an authorized committee and a political party committee.  As such, all of the
    operating expenditures disbursed by the Committee are fundraising expenses in
    support of the joint fundraising activities.  Each participant's share of the
    fundraising expenses, as determined pursuant to the Commission's regulations at
    11 C.F.R. Sec. 102.17, are deducted from the gross proceeds distributed to each.
    Therefore, each participant in effect pays for their fundraising expenses rather
    than the joint fundraising representative.  Expenditures for Catering, Facility
    Rental, Photography and Printing itemized on Schedule B are operating expenses
    and are not in-kind contributions or independent expenditures, nor are they public
    communications or voter drive activity. Express advocacy is not an issue.  2.  Mr.
    Joseph Danis contributed $12100 to the joint fundraising committee.  A second
    contribution for $12100 is attributable to his spouse, Lynn Danis, since her signature
    is on the check.  The attribution is corrected in this amendment."
